import { useState,useEffect } from 'react'
import {fetchCoins} from '../api_s/fetchCoins'
import Item from './Item'

function CoinList(){
    const [coins,setCoins]=useState(null)
    useEffect(()=>{
        fetchCoins().then(data=>setCoins(data)).catch(err=>console.error(err))
    },[])//se executa doar cand se monteaza componenta(prima data)
    useEffect(()=>{
        console.log(coins)
    },[coins])
    return(
        <tbody>
            {coins&& coins.map(coin =><Item item={coin} key={coin.id}/>)}
        </tbody>
    )
}
export default CoinList
